import React from 'react';

function Dashboard() {
  // Placeholder data
  const project = {
    name: 'Inferno Benchmark v1',
    path: '/user/projects/inferno-v1',
    modelsLoaded: [],
    lastComparison: null,
  };
  const system = {
    gpu: '32% used - RTX 4090',
    vram: '6.2 / 24 GB',
    ram: '14 / 32 GB',
    threads: '12 / 16',
    backend: 'llama.cpp',
  };
  const modelStatus = [
    { name: 'Mistral 7B', format: 'GGUF', size: '4.2GB', quant: 'Q4_K_M', loaded: true },
  ];
  const recent = [
    'Loaded Mistral 7B Q4_K_M',
    'Ran comparison between Mistral & Zephyr',
    'Edited prompt template "customer-support"',
    'Saved comparison output comparison-07-18.json',
  ];
  const pinned = [
    'Compare Zephyr vs LLaMA3',
    'Edit Prompt: "Longform QA test"',
    'View Metrics: "Coding vs Dialogue"',
  ];

  return (
    <div style={{ display: 'flex', flexDirection: 'column', gap: 32 }}>
      {/* Project Overview */}
      <section>
        <h2>🧾 Current Project Overview</h2>
        <div><b>Project Name:</b> {project.name}</div>
        <div><b>Models Loaded:</b> {project.modelsLoaded.length ? project.modelsLoaded.join(', ') : 'None'}</div>
        <div><b>Last Comparison:</b> {project.lastComparison || 'None'}</div>
        <div><b>Project Path:</b> {project.path}</div>
      </section>

      {/* Quick Actions */}
      <section>
        <h2>⚡ Quick Actions</h2>
        <div style={{ display: 'flex', gap: 16, flexWrap: 'wrap' }}>
          <button>🔁 Start New Comparison</button>
          <button>➕ Add New Model</button>
          <button>🎯 Test Prompt in Prompt Studio</button>
          <button>📁 Open Recent Session</button>
        </div>
      </section>

      {/* System & Runtime Status */}
      <section>
        <h2>📊 System & Runtime Status</h2>
        <div style={{ display: 'flex', gap: 32, flexWrap: 'wrap', alignItems: 'center' }}>
          <div><b>GPU Usage:</b> {system.gpu}</div>
          <div><b>VRAM Usage:</b> {system.vram}</div>
          <div><b>RAM Usage:</b> {system.ram}</div>
          <div><b>Threads Used:</b> {system.threads}</div>
          <div><b>Backend Runtime:</b> {system.backend}</div>
        </div>
        {/* Mini visual indicators (bars/circles) can be added here */}
      </section>

      {/* Model Status */}
      <section>
        <h2>🧠 Model Status</h2>
        {modelStatus.length === 0 ? (
          <div>No model loaded</div>
        ) : (
          <table style={{ width: '100%', borderCollapse: 'collapse', marginTop: 8 }}>
            <thead>
              <tr style={{ background: '#222', color: '#fff' }}>
                <th>Model Name</th><th>Format</th><th>Size</th><th>Quant</th><th>Loaded</th>
              </tr>
            </thead>
            <tbody>
              {modelStatus.map(m => (
                <tr key={m.name} style={{ background: m.loaded ? '#e0ffe0' : '#fff' }}>
                  <td>{m.name}</td>
                  <td>{m.format}</td>
                  <td>{m.size}</td>
                  <td>{m.quant}</td>
                  <td>{m.loaded ? '✅' : '❌'}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>

      {/* Recent Activity */}
      <section>
        <h2>🕓 Recent Activity</h2>
        <ul>
          {recent.map((item, i) => <li key={i}>{item}</li>)}
        </ul>
      </section>

      {/* Pinned Tools / Shortcuts */}
      <section>
        <h2>📎 Pinned Tools / Shortcuts</h2>
        <ul>
          {pinned.map((item, i) => <li key={i}>{item}</li>)}
        </ul>
      </section>
    </div>
  );
}

export default Dashboard;
